import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

const Home = () => {
  return (
    <div className="home-container">
    {/* Header Section */}
    <header className="header">
      <div className="logo-container">
        <img src="/images/hello.webp" alt="Company Logo" className="logo"/>
        <h1 className="company-name">ElectroVolt</h1>
      </div>
      <nav className="navigation">
        <Link to="/about">About Us</Link>
        <Link to="/solutions">Solutions</Link>
        <Link to="/charge-locator">Charge Locator</Link>
        <Link to="/contact">Contact Us</Link>
        <Link to="/support">Support</Link>
        <Link to="/">Ho</Link>
      </nav>
    </header>

    {/* Rest of your home page content goes here */}
    <div className="main-content">
      <h2>Welcome to ElectroVolt!</h2>
      {/* Add more content as needed */}
    </div>
  </div>
  );
};

export default Home;
